(24, 1, '2020-05-29 10:15:24', '2020-05-29 10:15:24', '<!-- wp:paragraph -->\n<p>Three best friends from a college, Priti, Ravina and Sheetal together ventured into the business, Arsty Jewelry in 2019. They never thought they would start a business in their life ! Curiosity to make jewelry for themselves after watching YouTube channel, slowly turned into a business. An idea that was appreciated and supported by their friends and teachers ! In the beginning each one of them was individually inspired by the YouTube channel and finally collectively, this same passion and interest brought them together. The girls started making earrings, bangles and necklaces which found buyers in friends and teachers ! This motivated them further when their parents supported them completely in their venture, giving rise to budding entrepreneurs!</p>\n<!-- /wp:paragraph -->', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2020-06-04 09:42:14', '2020-06-04 06:42:14', '', 0, 'http://localhost/jewel/?page_id=24', 0, 'page', '', 0),
