(498, 1, '2020-06-04 09:42:14', '2020-06-04 06:42:14', '<!-- wp:paragraph -->\n<p>Three best friends from a college, Priti, Ravina and Sheetal together ventured into the business, Arsty Jewelry in 2019. They never thought they would start a business in their life ! Curiosity to make jewelry for themselves after watching YouTube channel, slowly turned into a business. An idea that was appreciated and supported by their friends and teachers ! In the beginning each one of them was individually inspired by the YouTube channel and finally collectively, this same passion and interest brought them together. The girls started making earrings, bangles and necklaces which found buyers in friends and teachers ! This motivated them further when their parents supported them completely in their venture, giving rise to budding entrepreneurs!</p>\n<!-- /wp:paragraph -->', 'About Us', '', 'inherit', 'closed', 'closed', '', '24-revision-v1', '', '', '2020-06-04 09:42:14', '2020-06-04 06:42:14', '', 24, 'http://localhost/jewel/2020/06/04/24-revision-v1/', 0, 'revision', '', 0),
